import React from "react";
import Image1 from "../../assets/service-1.svg";
import Image2 from "../../assets/service-2.svg";
import Image3 from "../../assets/service-3.svg";
import "./services.css";
const data = [
  {
    id: 1,
    image: Image1, // Assuming Image1 is imported or defined elsewhere
    title: "Front-end Webpage Design",
    description: "Offering comprehensive front-end design services utilizing modern technologies such as React, Vue, and Angular. We specialize in creating intuitive UI/UX designs, incorporating AI-powered chatbots for enhanced user interaction, secure login systems for user authentication, and efficient ticketing systems for customer support. Our goal is to ensure your website is not only aesthetically pleasing but also highly functional and user-friendly.",
  },
  {
    id: 2,
    image: Image2, // Assuming Image2 is imported or defined elsewhere
    title: "Mechanical Engineering: Plastic Prototyping",
    description: "Providing end-to-end solutions for plastic prototyping through advanced techniques such as 3D printing and injection molding. Our services cater to businesses looking to prototype their mechanical designs efficiently and cost-effectively. From concept validation to functional testing, we leverage state-of-the-art technology to bring your mechanical engineering projects to life, ensuring high-quality prototypes that meet industry standards.",
  },
  {
    id: 3,
    image: Image3, // Assuming Image3 is imported or defined elsewhere
    title: "E-commerce Logistics Consulting",
    description: "Expert consulting services for B2B and B2C e-commerce logistics, focusing on optimizing your supply chain and distribution strategies. We specialize in integrating platforms such as TikTok, Etsy, and Shopify, providing tailored solutions to enhance your online presence and sales channels. Our approach includes comprehensive market analysis, platform-specific optimization, and advanced logistics planning to ensure your e-commerce operations are efficient and scalable.",
  },
];


const Services = () => {
  return (
    <section className="services container section" id="services">
      <h2 className="section__title">Services</h2>
      <div className="services__container grid">
        {data.map(({ id, image, title, description }) => {
          return (
            <div className="services__card" key={id}>
              <img src={image} alt="" className="services__img" />
              <h3 className="services__title">{title}</h3>
              <p className="services__description">{description}</p>
            </div>
          );
        })}
      </div>
    </section>
  );
};

export default Services;
